	constructor(props) {
		super(props);
		this.state = {}
	}

	lookingForTags() {
		const tags = this.props.data.map((eachProd) => (eachProd.arrTags));
		const topTags = [];
		let eventNumbers = [];
		tags.map((occurrence) => (
			occurrence.map((eachTag) => (
				(topTags.indexOf(eachTag) === -1) ? topTags.push(eachTag) : eventNumbers.push(1) 		
			))
		))
	}

	render() {
		return (
			<div>
				<p id="first">a</p>
				<p id="second">b</p>
				<p id="third">c</p>
				<p id="fourth">d</p>
				<p id="fifth">e</p>
			</div>
		);
	}
}

export default TopTags;
